description:
This stunning and dangerous series spotlights both the controversial Japanese whaling trade and the tactics that the Sea Shepherd Conservation Society and its staff and volunteers use to cripple it. Aboard the Motor Yacht &quot;Steve Irwin&quot; the group seeks out the Japanese whaling fleet and then uses it's Delta Zodiac, helicopter, and other innovative techniques to enforce the law on the high seas. 

